const Header = (props) =>{
    return(
      <div>
        <h3>Course Name: {props.course}</h3>
      </div>
    )
}

const Content = (props) =>{
    return(
      <div>
        <p>This course has 3 parts: </p>
        <dl>
          <dt>Part1: {props.part1} has {props. exercises1} exercises</dt>

          <dt>Part2: {props.part2} has {props. exercises2} exercises</dt>

          <dt></dt>

        </dl>
      </div>
    )
}

const Total = () =>{
    return(
      <div></div>
    )
}

const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
     <Header course={course}/>
     <Content part1={part1} exercises1={exercises1}
     part1={part2} exercises1={exercises2}
     part1={part3} exercises1={exercises3}/>
     <Total />
    </div>
  )
}
// export default App
export default App
